import transactions from '../../data/transactions.json';

export const TableBody = () => {
  return (
    <tbody>
      $
      {transactions.map(item => {
        <tr>
          <td>Invoice</td>
          <td>125</td>
          <td>USD</td>
        </tr>;
      })}
    </tbody>
  );
};
